Lalu Lintas Menyapa

Satlantas Polres Bantul melaksanakan kegiatan Lalu Lintas Menyapa di pimpin oleh Kasat Lantas Polres Bantul AKP Satya Dhira Anggoro Arrya N. S.Tr.K.,S.I.K.,M.Sc. bersama dengan para pengemudi truk UD Sri Rahayu.

Kegiatan ini bertujuan guna meningkatkan kesadaran dalam berlalu lintas serta tata cara muat kendaraan yang sesuai dengan aturan yang sudah di tentukan.

