Selasa (17/6/2025) Dalam rangka memperingati Hari Bhayangkara Ke-79, Polres Gunungkidul menyelenggarakan kegiatan Bakti Religi  bersama Polsek Semanu yang berlokasi di Semanu Selatan Rt 03/40, Semanu, Gunungkidul. Terdapat tiga lokasi dalam kegiatan ini yakni Makam Gedhong, Makam Gedhe dan Masjid Al-Hikmah. Kegiatan dipimpin oleh Ibu Kapolres Gunungkidul. Kegiatan berjalan dengan lancar kondusifâ€¦
